    [],nt"revision_timestamp": "2016-05-25T00:52:55.581704",nt"name": "reduced-vertical-separation-minimum-altimeter",nt"isopen":
    true,nt"url": null,nt"notes": "Reduced Vertical Separation Minimum Altimeter
    (Domestic) (RVSM Alt (Domestic)) is a source of altitude data or information that
    was added to support the RVSM capability.  It consists of two independent altimeters
    with enhanced transducers or double aneroid sensors for computing altitude.  The
    altitude source is connected through the static system to provide an automatic means
    of correcting the known static source error of the aircraft to improve aircraft
    altitude measurement capability.  Domestic RVSM Alt may also be used to satisfy
    Oceanic RVSM and the altitude sensor may be included within an air data computer.",nt"license_title":
